import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Map from '../components/Map';


const Page = () => {
    return(
        <>
            <Switch>
            <Route path="/" exact component={Map}/>
            </Switch>
        </>
    )
}

export default Page;
